						<div itemprop="articleBody">
		<p style="text-align: center;"><strong>D. 30.05.12 kl. 17:00</strong></p>
<p style="text-align: center;"><strong>i lokalerne for Lægedansk på</strong></p>
<p style="text-align: center;"><strong>Gentofte Hospital</strong></p>
<p style="text-align: center;"><strong>opg. 12., 4. sal lokale 556</strong></p>
<p style="text-align: center;"><strong>Niels Andersensvej 65</strong></p>
<p style="text-align: center;"><strong>2900 Hellerup</strong></p>
<p>Hvad går godt, hvad er gået dårligt? Hvad gør de andre? Vi vil tale om udfordringer og glæder &nbsp;- muligheder og begrænsninger ved at være mentor for en udenlandsk læge.</p>
<p>Er du ikke mentor endnu, men overvejer at blive det? Så kom alligevel.</p>
<p>Jeg beder om til- eller afmelding via mail ( <a href="mailto:lippamaria@yahoo.de">lippamaria@yahoo.de</a> <span style="display: none;">Denne emailadresse er beskyttet mod programmer som samler emailadresser. Du skal aktivere javascript for at kunne se adressen. </span>) senest d. 23.05.12</p>
<p>Jeg glæder mig til at se Jer,</p>
<p>Venlig hilsen</p>
<p>Maria Lippa</p>	</div>

	
